There is more than one artist with this name, including: 
1) Blue Rose was a French band who had a hit with "Don’t You Know (Ambushed)” in 1982; 
2) Blue Rose was an American bluegrass and acoustic country band active in the 1980s; 
3) Blue Rose was an American rock band active in the 1970s; 
4)  Blue Rose was an electro artist active in the 2000s; 
5) Blue Rose is an American country band from Chicago, IL. 
6) Blue Rose was an American band formed in 1992 by Jon Martin and Corey Storm.  <a href="https://www.last.fm/music/Blue+Rose">Read more on Last.fm</a>

